import React from 'react';
import { useParams, Route } from 'react-router-dom';
import robots from './robots';

function RobotDetails() {
    const { id } = useParams();
    const robot = robots.find(robot => robot.id === Number(id));

    if (!robot) {
        return <div>Robot not found</div>;
    }

    return (
        <div className="robot-details">
            <h2>{robot.name}</h2>
            <p>Serial Number: {robot.serialNumber}</p>
            <p>Manufacturer: {robot.manufacturer}</p>
            <p>Status: {robot.status}</p>
            <p>Description: {robot.description}</p>
        </div>
    );
}

function RobotDetailsWrapper() {
    return (
        <Route path="/:id">
            <RobotDetails />
        </Route>
    );
}

export default RobotDetails;
